        <!-- Open graph metadata -->

ess":"Reversed words aren't much harder to guess.","predictable substitutions like @ instead of a dont help very much":"Predictable substitutions like '@' instead of 'a' don't help very much."},components:{about_faq:{security:{name:"Security",qa:[{question:"What are the advantages of downloading this application?",answer:"The versions available for download are stable and are less likely to contain a security vulnerability due to an update."},{question:"How does my coin are stored?",answer:"Your coin are stored on the behalf of your seed (private key in particular), which can only be used with the access to the blockchain respectively to the wallet in question. Many exchanges keep your coins when you're not withdrawing them, we do not."},{question:"How does my data are encrypted?",answer:"Your data are encrypted trough Triplesec, see (https://keybase.io/triplesec) to get more information."},{question:"Where does my data are stored?",answer:"Your seed (you're whole account) can generate all your crypto wallet it is stored in clear on your computer (with PouchDB on your browser) in persistent mode when logged and encrypted in non-persistent mode or when logged out."},{question:"What if I loose my seed?",answer:"If you loose your seed, (You should write it down on paper) you can only get it back if you're account has not be cleared from your browser, you may need to log in or not."},{question:"What if I loose my password?",answer:"No worries, only your seed is needed to get back everything."},{question:"Can I print my password / seed?",answer:"When you're using the persistent mode for connection or if you print / store a document on your computer or printer, it may mostly last forever even if you format your storing device."}]},organization:{name:"Orgnaization",qa:[{question:"Who is crypto.red?",answer:"Crypto.red is an open-source project coded by a single programmer from scratch (which is/was a bit of a mad developer and designer) who realised one of his mission was to provide something life-hackers would love. He also make sure to maintain a good networking with non-dangerous hackers and bring other open-source projects money earned."},{question:"Who can contribute to this project?",answer:"Anyone, see https://github.com/crypto-red to get involved."},{question:"Who decide what to code?",answer:"Our team which is on GitHub (https://github.com/crypto-red) must agree together, meanwhile, one may duplicate the project for its own need."},{question:"Who have funded this project?",answer:"Anonymous."}]},privacy:{name:"Privacy",qa:[{question:"What is public on my account?",answer:"Your public key (blockchain address). You should not link your identity with your wallet's address if you want a complete privacy. You can also use a crypto mixer to obfuscate the source of your funding on a new wallet."}]},fees:{name:"Fees",qa:[{question:"What are the fees of using it?",answer:"We have an affiliate link for selling and trading cryptocurrency, theses partners rewards us with a part of their profit, meanwhile they compare where you can buy and trade cryptocurrency at the best exchange rate without increasing the operation cost for you."}]},usage:{name:"Usage",qa:[{question:"Should I use it if it can present a risk for my fund?",answer:"You should download a stable version from the link in the menu if you want to use it with a lot of money on it."}]}},about_info:{intellectual:{title:"Intellectual property",content_markdown:'MIT License\n\nCopyright (c) 2021 vipertech.ch\n\nCopyright (c) 2021 crypto.red\n\nPermission is hereby granted, free of charge, to any person obtaining a copy of this software and associated documentation files (the "Software"), to deal in the Software without restriction, including without limitation the rights to use, copy, modify, merge, publish, distribute, sublicense, and/or sell copies of the Software, and to permit persons to whom the Software is furnished to do so, subject to the following conditions:\n\nThe above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.\n\nTHE SOFTWARE IS PROVIDED "AS IS", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE AUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER LIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM, OUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE SOFTWARE.'},terms:{title:"Terms of use",content_markdown:'Wallet.crypto.red Terms of Use\n\nDate of Revision. 11 April, 2021\n\nPlease read these Terms carefully before using this website. By using this website (the "Website"), the user ("You") has accepted these Terms of Use. If You do not accept these Terms of Use, do not use the Website. By using this Website, you represent that you are of legal age to form a binding contract with Crypto.red.\n\nCRYPTO RED (crypto.red and its subdomains) may modify all or any part of these Terms of Use from time to time and may not provide notice to You. You are encouraged to check back often so You are aware of your current rights and responsibilities. Your continued use of this Website after changes to the Terms of Use have been published constitutes your binding acceptance of the updated Terms of Use. If at any time the Terms of Use are no longer acceptable to You, You should immediately cease all use of this Website.\n\n1.  Statement of Purpose. The purpose of Wallet.crypto.red is to enable individuals and organizations to access the world of cryptocurrency throughout a simple yet powerful open-source software more especially called a progressive web app (PWA). The site is designed to enable one to buy, sell, trade, and interact with cryptocurrency. It is also designed to encourage the creation of a user community to make this life a wonderful adventure when it comes to cryptocurrency generally speaking.\n    \n2.  User Registration. Registration at wallet.crypto.red is optional but encouraged. If you are registered at wallet.crypto.com, Crypto.red and its subdomains will not be able to contact you with information that you shared with this application, in reality, all that you\'ve registered on this site instance will stay on your computer and will never be shared with any network excepted when you need to make transactions or network requests, then, only non-private information will be shared as it needs to like the public address of your computer or cryptocurrency seed-derived address. You agree not to sell or transfer your use of or access to this Website or permit anyone else whose account was suspended or terminated to use this Website through your user name or password. You are responsible for maintaining the confidentiality of your password and account and for all activity that occurs on your account.\n    \n3.  Fees at third-party provider. Fees at: trading, buying, selling, and withdrawing among others cryptocurrencies may apply, theses fees are not higher and in some case lower when you pass trough this website to operate a contract with a third-party service provider such as Changelly or swapspace, the platforms mentioned before charges fees and rewards crypto.red for the clients comming from this application, it helps fund this software. You can use any third-party exchanges you want which aren\'t listed on this website, our partners should theoretically have the best bid for your need nonetheless.\n    \n4.  LIMITATION ON LIABILITY. THIS WEBSITE AND ALL CONTENT, MATERIALS, INFORMATION, SOFTWARE, PRODUCTS AND SERVICES ARE PROVIDED ON AN "AS IS" AND "AS AVAILABLE" BASIS. YOUR USE OF THIS WEBSITE IS AT YOUR OWN RISK. CRYPTO RED DISCLAIMS ALL WARRANTIES, EXPRESS OR IMPLIED, INCLUDING WITHOUT LIMITATION WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, AND NONINFRINGEMENT. TO THE FULLEST EXTENT PERMITTED BY LAW, CRYPTO RED IS NOT LIABLE FOR ANY DIRECT, INDIRECT, PUNITIVE, SPECIAL, INCIDENTAL,CONSEQUENTIAL, OR EXEMPLARY DAMAGES (INCLUDING, WITHOUT LIMITATION, LOSS OF BUSINESS, REVENUE, PROFITS, GOODWILL, USE, DATA, ELECTRONICALLY TRANSMITTED ORDERS, OR OTHER ECONOMIC ADVANTAGE) ARISING OUT OF OR IN CONNECTION WITH THE WEBSITE, EVEN IF CRYPTO RED HAS PREVIOUSLY BEEN ADVISED OF, OR REASONABLY COULD HAVE FORESEEN, THE POSSIBILITY OF SUCH DAMAGES, HOWEVER THEY ARISE, WHETHER IN BREACH OF CONTRACT OR IN TORT (INCLUDING NEGLIGENCE), INCLUDING WITHOUT LIMITATION DAMAGES DUE TO (a) THE USE OF OR THE INABILITY TO USE THE WEBSITE; (b) THE COST OF PROCUREMENT OF SUBSTITUTE GOODS AND SERVICES RESULTING FROM ANY GOODS, DATA, INFORMATION OR SERVICES PURCHASED OR OBTAINED OR MESSAGES RECEIVED OR TRANSACTIONS ENTERED INTO, THROUGH OR FROM THE WEBSITE; ( c) STATEMENTS OR CONDUCT OF ANY THIRD PARTY ON THE WEBSITE, INCLUDING WITHOUT LIMITATION UNAUTHORIZED ACCESS TO OR ALTERATION OF TRANSMISSIONS OR DATA, MALICIOUS OR CRIMINAL BEHAVIOR, OR FALSE OR FRAUDULENT TRANSACTIONS, OR (d) CONTENT OR INFORMATION YOU MAY DOWNLOAD, USE, MODIFY OR DISTRIBUTE. CRYPTO RED MAKES NO WARRANTY THAT, (i) THE SERVICE WILL BE UNINTERRUPTED, TIMELY, SECURE, OR ERROR-FREE, (ii) THE RESULTS THAT MAY BE OBTAINED FROM THE USE OF THE SERVICE WILL BE ACCURATE OR RELIABLE, (iii) THE QUALITY OF ANY PRODUCTS, SERVICES, CONTENT, INFORMATION, OR OTHER MATERIALS OBTAINED BY YOU THROUGH THE SERVICE WILL MEET YOUR EXPECTATIONS, (iv) ANY ERRORS IN THE SOFTWARE WILL BE CORRECTED, OR THAT THIS WEBSITE, ITS CONTENT, AND THE SERVER ON WHICH THE WEBSITE AND CONTENT ARE AVAILABLE ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS. ANY MATERIAL (INCLUDING CONTENT) DOWNLOADED OR OBTAINED THROUGH THE USE OF THIS WEBSITE IS DONE AT YOUR OWN RISK AND YOU WILL BE SOLELY RESPONSIBLE FOR ANY DAMAGE TO YOUR COMPUTER SYSTEM OR LOSS OF DATA THAT RESULTS FROM THE DOWNLOAD OF ANY MATERIAL. INFORMATION CREATED BY THIRD PARTIES THAT YOU MAY ACCESS ON THIS WEBSITE OR THROUGH LINKS IS NOT APPROVED, ADOPTED OR ENDORSED BY CRYPTO RED AND REMAINS THE RESPONSIBILITY OF THE THIRD PARTY.TO THE EXTENT ANY JURISDICTION DOES NOT ALLOW THE EXCLUSION OR LIMITATION OF DIRECT, INCIDENTAL OR CONSEQUENTIAL DAMAGES, PORTIONS OF THE ABOVE LIMITATION OR EXCLUSION MAY NOT APPLY.'}},about_wiki:{topup:{title:"How to top-up",content_markdown:"{{{_svg.buy_crypto}}}Although we receive nothing if you don't use Changelly, it is a simple service and the second recommended after public ATMs for privacy concerns.\n\nYou will have to follow the instruction and at the end enter the public address of the coin selected of the account you've chosen and that's it, you can pay by card and do it quickly and simply."},swap:{title:"How to swap cryptocurrency",content_markdown:'{{{_svg.swap_crypto_currency}}}You have to go to the convert menu item in the drawer at left (burger menu on mobile devices) and use a "swap" services, we currently use SwapSpace.co since it doesn\'t charge more than the showed swap exchange that it compare for you so you can be sure to pay the less on the market!\n\nYou have to choose the amount an the currency you want to send along with the currency you want to receive in exchange. Then click on the "VIEW OFFERS" button.\n\nThen just choose the exchange you want to use for the conversion you\'re doing, it should show many offers of all-trusted exchange. So when you have clicked on the "EXCHANGE" button just enter the new address of the currency you will receive, you have to copy the right address from the right account of yours of the cryptocurrency you have chosen to receive in exchange of the amount you\'ll have to send.\n\n**In other words:**\n\n1.  Enter the amount and choose the swap service.\n2.  Enter the recipient address.\n3.  Transfer your funds to the exchange service.\n4.  Wait for the exchange to proceed.'},mixer:{title:"How to mix cryptocurrency",content_markdown:"{{{_svg.mix_crypto_currency}}}\nWe currently use Blender.io, it will enable you to mix your coin with other coin it will be like if your coins disappeared in the nether and from completely different sources came (other coins nearly with the same amount) to an address (maybe a completely new one if you create a new account for that) hours or even days later!\n\nYou just have to create a new account on wallet.crypto.red in order to generate a fresh new and new address and to put that address in the mixer (you can split the amount send to multiples address). Then just send the amount you like from the account you have chosen to use for sending coins.\n\nBe careful! Don't send back the coins you received from the mixer onto the new address you've freshly created, it will enable one to know that this address is linked to the previous one (obvious captain)."},crypt:{title:"Encrypt and decrypt messages",content_markdown:"{{{_svg.asymmetric_encryption}}} \nIn order to decrypt a message someone has sent to you, you'll have to know both your public and private key linked to the message which is an obfuscated text, since the software knows it, if you go onto tools then crypto then decrypt then autofill keys, the keys will be magically filled into our cryptographic system. You'll only have to copy the obfuscated message received and click autofill then show.\n\nIn order to encrypt a message to someone, you'll have to know the receiver's public key, just look at a transaction from this person and copy the public key which you'll have to enter in the cryptographic tool (Encrypt tab) in tools then crypt along with the message. If you click autofill keys on encrypt section, it will be meant to be sent to yourself."},contribute:{title:"How to contribute",content_markdown:"{{{_svg.open_source}}}You can contribute to our repository, this is where our code and application is hosted: [https://github.com/crypto-red/crypto-red.github.io](https://github.com/crypto-red/crypto-red.github.io) (everything is transparent on GitHub). You can also donate to us in order to accelerate de development of this project and other projects (since we also fund other projects that we use trough [OpenCollective](https://opencollective.com/crypto-red)) trough sending bitcoin in the address shown where our code is hosted."}},account_card:{crypto_balance_error:"{{crypto_id}} balance error",close_account_tooltip:"Do you want to close this account?",open_account_tooltip:"Do you want to open this account?"},account_dialog_backup:{seed:"Seed of {{account_name}}",store:"STORE IT ON PAPER, NEVER SHARE THIS SEED TO ANYONE!!!",encrypted_seed_qr:"Encrypted seed (PDF/QR)",password_qr:"Seed's password (PDF/QR)",download_encrypted_seed:'Encrypted seed of "{{account_name}}"',download_password:'Seed\'s password of "{{account_name}}"'},account_dialog_close:{close:"Close {{account_name}}?",opened:"This account was opened {{time_ago}}"},account_dialog_create:{password_evaluation_warning:"WARNING: Only {{time}} is required to crack your password.",password_evaluation_good:"That's good! Your password is strong.",password_strength:"Password strength is {{score}} / 4",configuration_view:{description:"Provide a name and a STRONG PASSWORD in order to create a new account.\nEverything that you type won't never be send to anyone, it will stay on your device.\nOnce a name and a password to encrypt your backup phrase is set, we will enable you to manually create or import your new backup phrase (called a mnemonic)."},mnemonic_view:{description:"Use an old backup phrase from another wallet or use a new random backup phrase.\nThe backup phrase is a like a seed password that will create a master key, from this key, it will create derived keys pair for each cryptocurrency.\nThe password you typed in the first step will enable you to log in using a password instead of this  backup phrase each and every time.\n",description_bold:"Make sure no one is looking before completing the field below and STORE IT ON PAPER for a better security.",usual_s hese are all things that would have been considered magic a few hundred years ago. So engineering is for all intents and purposes, magic, and who wouldn't want to be a magician?"},{author:"Unknown",text:"If the word government literally means \"to control the mind,\" wouldn't learning to control your own mind negate the opportunity for outside government? You see, it's the simple act of asking questions that exemplifies the Achilles heel of the control system; you can condition animals, but if humans ask questions, they can learn the path to freedom."},{author:"Unknown",text:"Truth cannot be taught. It must be experienced therefore always consider the inner light of understanding before the outer light of common dogma."},{author:"Gandhi",text:"There are many causes I would die for. There is not a single cause I would kill for."},{author:"Unknown",text:"You know what, sometimes I really do not know what needs to be done here on earth to get the people moving because they are still sitting in their chair. And I do not refer to violent rebellion of some kind. No, I am talking about making connection. Unite."}],ready_to_start_cta:"Ready to start now? Create a new anonymous wallet!"},settings:{settings_changed:"Settings changed",language:"Language",currency:"Currency",sound:"Sound",enable_sound_effects:"Enable sound effects",superintendent:"Superintendent",enable_the_superintendent:"Enable the superintendent",make_jamy_active:"Make Jamy active",description_of_jamy:"Jamy is responsible for the surveillance, judgement, and reaction of your actions as a user. He can't tell anyone what you are doing, but he is present if you enable him to be so.",security:"Security",enable_reset_option_in_menu:"Enable reset option in menu"}}}},function(e,t,n){"use strict";e.exports={_plurals:{key:{one:"cl",many:"cls"}},_svg:{mix_crypto_currency:{mixer_image:"Image de mlangeur",your_coins:"Vos pices",random_coins:"Pices alatoires",your_previous_coins:"Vos anciennes pices"},asymmetric_encrypti resse copie avec succs","url successfully copied":"Url copie avec succs","text successfully copied":"Texte copi avec succs","public key successfully copied":"Cl publique copie avec succs","cannot copy this address":"Impossible de copier cette adresse","cannot copy this url":"Impossible de copier cette url","cannot copy this text":"Impossible de copier ce texte","cannot copy this public key":"Impossible de copier cette cl publique","cannot copy non-existent url":"Impossible de copier une url non-existente","cannot copy non-existent text":"Impossible de copier un text non-existent","cannot copy a non-existent address":"Impossible de copier une adresse non-existente","cannot load more transaction":"Impossible de charger plus de transactions...","cannot copy a non-existent public key":"Impossible de copier une cl publique qui n'existe pas","copy address":"Copier l'adresse","copy public key":"Copy la cl publique","the longer you look the shiner i get":"Plus tu me regardes, plus je deviens blouissant","take a picture it last longer":"Prends une photo, a dure plus longtemps","stop bitchslapping me":"Arrte de m'agresser comme une baltringue","hey i am jamy":"Salut, je suis Jamy.","you need to add fund to this account":"Vous devez ajouter des fonds   ce compte","just do it trough the link in the menu":"Faites-le simplement au travers du lien dans le menu","no transactions maid":"Vous n'avez pas encore fait de transactions, mais elles seront affiches ici.","no transactions maid chart":"Vous n'avez pas encore fait de transactions, mais elles seront affiches ici dans un graphique.","no transaction maid portfolio":"Vous n'avez pas encore fait de transactions, par consquent, votre portfolio est vide et ne sera donc pas affich.","cannot load QR code scanner":"Impossible de charger le module d'analyse de QR code","transaction sent":"Transaction envoye","scan an address":"Lire une adresse",online:"Nous sommes en ligne !",offline:"Nous sommes hors ligne !","you must open an account":"Vous devez ouvir un compte.","use a few words avoid common phrases":"Utilisez quelques mots, vitez les phrases courantes.","no need for symbols digits or uppercase letters":"Pas besoin de symboles, de chiffres ou de lettres majuscules","add another word or two uncommon words are better":"Ajoutez un mot ou deux. Les mots peu communs sont meilleurs.","straight rows of keys are easy to guess":"Les ranges droites de touches sont faciles   deviner.","short keyboard patterns are easy to guess":"Les modles typographiques de clavier courts sont faciles   deviner.","use a longer keyboard pattern with more turns":"Utilisez un motif de clavier plus long avec plus de possibilits.","repeats like aaa are easy to guess":"Les rptitions comme aaa sont faciles   deviner.","repeats like abcabcabc are only slightly harder to guess than abc":'Les rptitions comme "abcabcabc " ne sont que lgrement plus difficiles   deviner que "abc".',"avoid repeated words and characters":"vitez les mots et les caractres rpts.","sequences like abc or 6543 are easy to guess":'Des squences comme "abc" ou "6543" sont faciles   deviner.',"avoid sequences":"viter les squences.","recent years are easy to guess":"Les dernires nouvelles annes sont faciles   deviner.","avoid recent years":"viter les annes recentes.","avoid years that are associated with you":"vitez les annes qui vous sont associes.","dates are often easy to guess":"Les dates sont souvent faciles   deviner.","avoid dates and years that are associated with you":"vitez les dates et les annes qui vous sont associes.","this is a top-10 common password":"Ceci est un des 10 premiers mots de passe courants.","this is a top-100 common password":"Ceci est un mot de passe commun du top 100.","this is a very common password":"C'est un mot de passe trs courant.","this is similar to a commonly used password":"Ceci est similaire   un mot de passe couramment utilis.","a word by itself is easy to guess":"Un mot en lui-mme est facile   deviner.","names and surnames by themselves are easy to guess":"Les noms et prnoms par eux-mmes sont faciles   deviner.","common names and surnames are easy to guess":"Les noms et prnoms communs sont faciles   deviner.","capitalization doesnt help very much":"La majuscule n'aide pas beaucoup.","all-uppercase is almost as easy to guess as all-lowercase":"Tout en majuscule est presque aussi facile   deviner que tout en minuscule.","reversed words arent much harder to guess":"Les mots inverss ne sont pas beaucoup plus difficiles   deviner.","predictable substitutions like @ instead of a dont help very much":'Les substitutions prvisibles comme "@" au lieu de "a" n\'aident pas beaucoup.'},components:{about_faq:{security:{name:"Securit",qa:[{question:"Quels sont les avantages de tlcharger cette application ?",answer:"Les versions disponibles au tlchargement sont stables et sont moins susceptibles de contenir une faille de scurit en raison d'une mise   jour."},{question:"Comment est stock ma monnaie ?",answer:"Vos monnaie sont stockes pour le compte de votre semence (cl prive notamment), qui ne peut tre utilis avec l'accs   la blockchain respectivement au portefeuille en question. De nombreux changes conservent vos pices lorsque vous ne les retirez pas, nous ne le faisons pas."},{question:"Comment mes donnes sont-elles cryptes ?",answer:"Vos donnes sont cryptes via Triplesec, voir (https://keybase.io/triplesec) pour obtenir plus d'informations."},{question:"O sont stockes mes donnes ?",answer:"Votre graine (votre compte entier) peut gnrer tout votre portefeuille crypto qu'il est stock en clair sur votre ordinateur (avec PouchDB sur votre navigateur) en mode persistant lorsqu'il est connect et crypt en mode non persistant ou lorsqu'il est dconnect."},{question:"Et si je perds ma graine ?",answer:"Si vous perdez votre graine, (vous devriez l'crire sur papier) vous ne pouvez obtenir que si votre compte n'a pas t effac de votre navigateur, vous devrez peut-tre vous connecter ou non."},{question:"Et si je perds mon mot de passe ?",answer:"Pas de soucis, seule votre graine est ncessaire pour tout rcuprer."},{question:"Puis-je imprimer mon mot de passe / graine ?",answer:" Lorsque vous utilisez le mode persistant pour la connexion ou si vous imprimez / stockez un document sur votre ordinateur ou votre imprimante, il peut durer pour toujours mme si vous formatez votre priphrique de stockage."}]},organization:{name:"Organisation",qa:[{question:"Qui est crypto.red ?",answer:"Crypto.red est un projet open source cod par un seul programmeur   partir de zro (qui est/tait un peu un dveloppeur et designer fou) qui a ralis que l'une de ses missions tait de fournir quelque chose que les hackers aimeraient. Il s'assure galement de maintenir un bon rseau avec des hackers non dangereux et d'apporter de l'argent gagn   d'autres projets open source."},{question:"Qui peut contribuer   ce projet ?",answer:"Tout le monde, voir https://github.com/crypto-red pour participer."},{question:"Qui dcide quoi coder ?",answer:"Notre quipe qui est sur GitHub (https://github.com/crypto-red) doit se mettre d'accord, en attendant, on peut dupliquer le projet pour son propre besoin."},{question:"Qui a financ ce projet ?",answer:"Anonymous."}]},privacy:{name:"Confidentialit ",qa:[{question:"Qu'est-ce qui est public sur mon compte ?",answer:"Votre cl publique (adresse blockchain). Vous ne devez pas lier votre identit   l'adresse de votre portefeuille si vous souhaitez une confidentialit totale. Vous pouvez galement utiliser un mixeur crypto pour masquer la source de votre financement sur un nouveau portefeuille."}]},fees:{name:"Frais",qa:[{question:"Quels sont les frais d'utilisation ?",answer:"Nous avons un lien d'affiliation pour vendre et changer des crypto-monnaies, ces partenaires nous rcompensent avec une partie de leurs bnfices , en attendant, ils comparent o vous pouvez acheter et changer des crypto-monnaies au meilleur taux de change sans augmenter le cot d'exploitation pour vous."}]},usage:{n e to You. You are encouraged to check back often so You are aware of your current rights and responsibilities. Your continued use of this Website after changes to the Terms of Use have been published constitutes your binding acceptance of the updated Terms of Use. If at any time the Terms of Use are no longer acceptable to You, You should immediately cease all use of this Website.\n\n1.  Statement of Purpose. The purpose of Wallet.crypto.red is to enable individuals and organizations to access the world of cryptocurrency throughout a simple yet powerful open-source software more especially called a progressive web app (PWA). The site is designed to enable one to buy, sell, trade, and interact with cryptocurrency. It is also designed to encourage the creation of a user community to make this life a wonderful adventure when it comes to cryptocurrency generally speaking.\n    \n2.  User Registration. Registration at wallet.crypto.red is optional but encouraged. If you are registered at wallet.crypto.com, Crypto.red and its subdomains will not be able to contact you with information that you shared with this application, in reality, all that you\'ve registered on this site instance will stay on your computer and will never be shared with any network excepted when you need to make transactions or network requests, then, only non-private information will be shared as it needs to like the public address of your computer or cryptocurrency seed-derived address. You agree not to sell or transfer your use of or access to this Website or permit anyone else whose account was suspended or terminated to use this Website through your user name or password. You are responsible for maintaining the confidentiality of your password and account and for all activity that occurs on your account.\n    \n3.  Fees at third-party provider. Fees at: trading, buying, selling, and withdrawing among others cryptocurrencies may apply, theses fees are not higher and in some case lower when you pass trough this website to operate a contract with a third-party service provider such as Changelly or swapspace, the platforms mentioned before charges fees and rewards crypto.red for the clients comming from this application, it helps fund this software. You can use any third-party exchanges you want which aren\'t listed on this website, our partners should theoretically have the best bid for your need nonetheless.\n    \n4.  LIMITATION ON LIABILITY. THIS WEBSITE AND ALL CONTENT, MATERIALS, INFORMATION, SOFTWARE, PRODUCTS AND SERVICES ARE PROVIDED ON AN "AS IS" AND "AS AVAILABLE" BASIS. YOUR USE OF THIS WEBSITE IS AT YOUR OWN RISK. CRYPTO RED DISCLAIMS ALL WARRANTIES, EXPRESS OR IMPLIED, INCLUDING WITHOUT LIMITATION WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, AND NONINFRINGEMENT. TO THE FULLEST EXTENT PERMITTED BY LAW, CRYPTO RED IS NOT LIABLE FOR ANY DIRECT, INDIRECT, PUNITIVE, SPECIAL, INCIDENTAL,CONSEQUENTIAL, OR EXEMPLARY DAMAGES (INCLUDING, WITHOUT LIMITATION, LOSS OF BUSINESS, REVENUE, PROFITS, GOODWILL, USE, DATA, ELECTRONICALLY TRANSMITTED ORDERS, OR OTHER ECONOMIC ADVANTAGE) ARISING OUT OF OR IN CONNECTION WITH THE WEBSITE, EVEN IF CRYPTO RED HAS PREVIOUSLY BEEN ADVISED OF, OR REASONABLY COULD HAVE FORESEEN, THE POSSIBILITY OF SUCH DAMAGES, HOWEVER THEY ARISE, WHETHER IN BREACH OF CONTRACT OR IN TORT (INCLUDING NEGLIGENCE), INCLUDING WITHOUT LIMITATION DAMAGES DUE TO (a) THE USE OF OR THE INABILITY TO USE THE WEBSITE; (b) THE COST OF PROCUREMENT OF SUBSTITUTE GOODS AND SERVICES RESULTING FROM ANY GOODS, DATA, INFORMATION OR SERVICES PURCHASED OR OBTAINED OR MESSAGES RECEIVED OR TRANSACTIONS ENTERED INTO, THROUGH OR FROM THE WEBSITE; ( c) STATEMENTS OR CONDUCT OF ANY THIRD PARTY ON THE WEBSITE, INCLUDING WITHOUT LIMITATION UNAUTHORIZED ACCESS TO OR ALTERATION OF TRANSMISSIONS OR DATA, MALICIOUS OR CRIMINAL BEHAVIOR, OR FALSE OR FRAUDULENT TRANSACTIONS, OR (d) CONTENT OR INFORMATION YOU MAY DOWNLOAD, USE, MODIFY OR DISTRIBUTE. CRYPTO RED MAKES NO WARRANTY THAT, (i) THE SERVICE WILL BE UNINTERRUPTED, TIMELY, SECURE, OR ERROR-FREE, (ii) THE RESULTS THAT MAY BE OBTAINED FROM THE USE OF THE SERVICE WILL BE ACCURATE OR RELIABLE, (iii) THE QUALITY OF ANY PRODUCTS, SERVICES, CONTENT, INFORMATION, OR OTHER MATERIALS OBTAINED BY YOU THROUGH THE SERVICE WILL MEET YOUR EXPECTATIONS, (iv) ANY ERRORS IN THE SOFTWARE WILL BE CORRECTED, OR THAT THIS WEBSITE, ITS CONTENT, AND THE SERVER ON WHICH THE WEBSITE AND CONTENT ARE AVAILABLE ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS. ANY MATERIAL (INCLUDING CONTENT) DOWNLOADED OR OBTAINED THROUGH THE USE OF THIS WEBSITE IS DONE AT YOUR OWN RISK AND YOU WILL BE SOLELY RESPONSIBLE FOR ANY DAMAGE TO YOUR COMPUTER SYSTEM OR LOSS OF DATA THAT RESULTS FROM THE DOWNLOAD OF ANY MATERIAL. INFORMATION CREATED BY THIRD PARTIES THAT YOU MAY ACCESS ON THIS WEBSITE OR THROUGH LINKS IS NOT APPROVED, ADOPTED OR ENDORSED BY CRYPTO RED AND REMAINS THE RESPONSIBILITY OF THE THIRD PARTY.TO THE EXTENT ANY JURISDICTION DOES NOT ALLOW THE EXCLUSION OR LIMITATION OF DIRECT, INCIDENTAL OR CONSEQUENTIAL DAMAGES, PORTIONS OF THE ABOVE LIMITATION OR EXCLUSION MAY NOT APPLY.'}},about_wiki:{topup:{title:"Comment recharger",content_markdown:"{{{_svg.buy_crypto}}}Bien que nous ne recevions rien si vous n'utilisez pas Changelly, il s'agit d'un service simple et le deuxime recommand aprs les guichets automatiques publics pour des raisons de confidentialit.\n\nVous devrez suivre les instructions et   la fin entrer l'adresse publique de la pice slectionne du compte que vous avez choisi et le tour est jou, vous pouvez payer par carte et le faire rapidement et simplement."},swap:{title:"Comment changer une crypto-monnaie",content_markdown:"{{{_svg.swap_crypto_currency}}}Vous devez accder   l'lment de menu convertir dans le tiroir de gauche (menu burger sur les appareils mobiles) et utiliser un \"swap\", nous utilisons actuellement SwapSpace.co car il ne facture pas plus que l'change de swap affich qu'il compare pour vous, vous pouvez donc tre sr de payer le moins cher sur le march !\n \nVous devez choisir le montant et la devise que vous souhaitez envoyer ainsi que la devise que vous souhaitez recevoir en change. Cliquez ensuite sur le bouton \"VOIR LES OFFRES\".\n\nEnsuite, choisissez simplement l'change que vous souhaitez utiliser pour la conversion que vous effectuez, il devrait afficher de nombreuses offres d'change de confiance. Ainsi lorsque vous avez cliqu sur le bouton \"EXCHANGE\" entrez simplement la nouvelle adresse de la devise que vous allez recevoir, vous devez copier la bonne adresse depuis le bon compte du vtre de la crypto-monnaie que vous avez choisi de recevoir en change du montant que vous devrez envoyer.\n\n**En d'autres termes :**\n\n1. Saisissez le montant et choisissez le service d'change.\n2. Saisissez l'adresse du destinataire.\n3. Transfrez vos fonds vers le service d'change.\n4. Attendez que l'change se poursuive."},mixer:{title:"Comment mlanger une crypto-monnaie",content_markdown:"{{{_svg.mix_crypto_currency}}}Nous utilisons actuellement Blender.io, cela vous permettra de mlanger votre pice avec d'autres pices, ce sera comme si vos pices disparaissaient dans le Nether et provenaient de sources compltement diffrentes (d'autres pices presque du mme montant)   une adresse (peut-tre une compltement nouveau si vous crez un nouveau compte pour cela) des heures ou mme des jours plus tard !\n\nIl vous suffit de crer un nouveau compte sur wallet.crypto.red afin de gnrer une nouvelle et nouvelle adresse et de mettre cette adresse dans le mixeur (vous pouvez diviser le montant envoy   plusieurs adresses). Ensuite, envoyez simplement le montant que vous souhaitez depuis le compte que vous avez choisi d'utiliser pour envoyer des pices.\n\nFais attention! Ne renvoyez pas les pices que vous avez reues du mixeur sur la nouvelle adresse que vous venez de crer, cela permettra de savoir que cette adresse est lie   la prcdente (capitaine vident)."},crypt:{title:"Crypter et dcrypter les messages",content_markdown:"{{{_svg.asymmetric_encryption}}}Pour dcrypter un message que quelqu'un a envoy pour vous, vous devrez connatre   la fois votre cl publique et prive lie au message qui est un texte obscurci, puisque le logiciel le sait, si vous allez sur des outils puis crypto puis dchiffrez puis les cls de remplissage automatique, les cls seront remplies comme par magie dans notre systme cryptographique. Vous n'aurez qu'  copier le message obscurci reu et cliquer sur remplissage automatique puis sur afficher.\n\nPour chiffrer un message   quelqu'un, vous devrez connatre la cl publique du destinataire, il suffit de regarder une transaction de cette personne et copiez la cl publique que vous devrez saisir dans l'outil cryptographique (onglet Crypter) dans les outils puis cryptez avec le message. Si vous cliquez sur les cls de remplissage automatique dans la section de chiffrement, elles seront destines   vous tre envoyes."},contribute:{title:"Comment contribuer",content_markdown:"{{{_svg.open_source}}}Vous pouvez contribuer   notre rfrentiel, c'est ici que notre code et notre application sont hbergs : [https://github.com/crypto-red/crypto-red.github.io](https://github.com/crypto-red/crypto-red.github.io) (tout est transparent sur GitHub). Vous pouvez galement nous faire un don afin d'acclrer le dveloppement de ce projet et d'autres projets (puisque nous finanons galement d'autres projets que nous utilisons via [OpenCollective](https://opencollective.com/crypto-red)) via l'envoi de bitcoin dans l'adresse indique o notre code est hberg."}},account_card:{crypto_balance_error:"Erreur des fonds pour {{crypto_id}}",close_account_tooltip:"Voulez-vous fermer ce compte ?",open_account_tooltip:"Voulez-vous ouvrir ce compte ?"},account_dialog_backup:{seed:"Graine de {{account_name}}",store:"STOCKEZ-LA SUR PAPIER, NE PARTAGEZ JAMAIS CETTE GRAINE  PERSONNE!!!",encrypted_seed_qr:"Graine chiffr (QR/PDF)",password_qr:"Mot de passe de la graine (QR/PDF)",download_encrypted_seed:'Graine chiffre de "{{account_name}}"',download_password:'Mot de passe de la graine chiffre de "{{account_name}}"'},account_dialog_close:{close:"Fermer {{account_name}} ?",opened:"Ce compte   t ouvert {{time_ago}}"},account_dialog_create:{password_evaluation_warning:"AVERTISSEMENT : Seul {{time}} est requis pour dchiffrer votre mot de passe.",password_evaluation_good:"C'est bien ! Votre mot de passe est fort.",password_strength:"La force du mot de passe est {{score}} / 4",configuration_view:{description:"Fournissez un nom et un MOT DE PASSE FORT afin de crer un nouveau compte.\nTout ce que vous saisissez ne sera jamais envoy   personne, tout restera bien sur votre appareil.\nUne fois qu'un nom et un mot de passe pour crypter votre phrase de sauvegarde sont dfinis, nous activerons vous devez crer ou importer manuellement votre nouvelle phrase de sauvegarde (appele mnmonique)."},mnemonic_view:{description:"Utilisez une ancienne phrase de sauvegarde d'un autre portefeuille ou utilisez une nouvelle phrase de sauvegarde alatoire .\nLa phrase de sauvegarde est comme un mot de passe initial qui crera une cl principale,   partir de cette cl, elle crera une paire de cls drives pour chaque crypto-monnaie.\nLe mot de passe que vous avez saisi   la premire tape vous permettra de vous connecter en utilisant un mot de passe au lieu de cette phrase de sauvegarde   chaque fois.",description_bold:"Assurez-vous que personne ne regarde avant de remplir le champ ci-dessous et STOCKEZ-LE SUR PAPIER pour une meilleure scurit.",usual_seed:"Une graine habituelle pour un mnmonique bip39 est longue de 12 mots."},generation_view:{generating:"Cration...",error:"ERREUR : votre compte n'a pas t cr.",success:"Votre compte sera bientt affich.",description:"Nous devons crer une adresse pour chaque crypto-monnaie rpertorie, ces adresses sont anonymes puisqu'elles ne sont pas lies   vous-mme. Nous ne sauvegarderons pas automatiquement votre compte sur votre ordinate
